import React from 'react'

export default function LinksBeforeLogin() {
    return (
        <>
            <li className="nav-item">
                <a className="nav-link active" aria-current="page" href="/">Home</a>
            </li>
            <li className="nav-item">
                <a className="nav-link" href="#">Login</a>
            </li>
        </>
    )
}
